import { SimpleGrid, Box } from '@chakra-ui/core';

export const Live = (props) => {
  return (
    <Layout>
      <SimpleGrid columns={[1, 2, 2]}>
        <Box>
          <Box bg='black'></Box>
        </Box>

        <Box>Preguntas</Box>
      </SimpleGrid>
    </Layout>
  );
};
export default Live;
